<noscript>&lt;a target=""_blank"" href=""http://ad.ch.doubleclick.net/click%3Bh%3Dv8/3ca3/3/0/%2a/h%3B253905814%3B0-0%3B0%3B45291487%3B4307-300/250%3B46800226/46816654/1%3B%3B%7Esscs%3D%3fhttp://www.conti-online.com/generator/www/ru/ru/continental/portal/general/home/index_ru.html""&gt;&lt;img src=""http://s0.2mdn.net/3544249/continental_football_standard_RU.gif""  border=""0"" alt="""" &gt;&lt;/a&gt;</noscript><noscript>&lt;p&gt;&lt;a href=""http://ad.ch.doubleclick.net/jump/euro2012.russian/section_single;pos=mpu_top;tile=1;sect=;kw=;sz=300x250;ord=123456789?"" onclick=""window.open(this.href); return false;""&gt;&lt;img src=""http://ad.ch.doubleclick.net/ad/euro2012.russian/section_single;pos=mpu_top;tile=1;sect=;kw=;sz=300x250;ord=123456789?"" width=""300"" height=""250"" alt="""" /&gt;&lt;/a&gt;&lt;/p&gt;</noscript><!-- End ad tag -->&nbsp;</div> </div><div class=""bF""> </div> </div> </div><div class=""row  ""> </div><div class=""row  ""><div class=""box ""><div class=""bH""><!--googleoff:index--><h3>Путь к финалу </h3> <!--googleon:index--> </div><div class=""bC""><div class=""clearLeft innerText""><div class=""fl newsBody""><div class=""newsText""><p>Чемпионат Европы 2010-12 состоит из трех этапов: отборочного группового раунда, стыковых матчей и финальной стадии. Последняя пройдет в Польше и Украине с 8 июня по 1 июля 2012 года.</p>
<p><strong>Отборочный групповой раунд</strong><br>На этом этапе 51 сборную разбивают на девять групп - шесть по шесть и три по пять. С 3 сентября 2010 по 11 октября 2011 года они соревнуются по круговой системе дома и на выезде. Победители групп и обладатель второго места, показавший&nbsp;лучшие результаты в матчах против первых пяти сборных своей группы напрямую выходят в финальный турнир. Остальные восемь сборных, занявшие вторые места, оспаривают еще четыре путевки в стыковых матчах.</p>
<p><strong>Стыковые матчи</strong><br>Четыре команды с более высоким рейтингом получат статус сеяных. Пары и порядок домашних и гостевых встреч определятся в ходе жеребьевки. Первые матчи будут сыграны 11 или 12 ноября, ответные - 15 ноября. Обладатели путевок в финальную стадию определятся по сумме двух встреч. В случае ничьей вступает в силу правило выездного гола, проводится дополнительное время либо серия пенальти.</p>
<p><strong>Финальная стадия</strong><br>При жеребьевке финальной стадии сборные Польши и Украины будут помещены в первую корзину с чемпионами ЕВРО-2008 испанцами, если те пройдут отбор. Оставшиеся команды будут распределены по корзинам в зависимости от рейтинга и впоследствии разбиты на четыре группы по четыре команды. Пара сильнейших из каждого квартета попадет в четвертьфинал. Начиная с этого этапа, матчи проходят по кубковой системе.</p>
<p>Более подробную информацию содержит <strong><a href=""http://www.uefa.com/MultimediaFiles/Download/Regulations/uefa/Others/91/48/36/914836_DOWNLOAD.pdf"">официальный регламент турнира (на английском)</a></strong>. С официальным расписанием матчей вы можете ознакомиться <a href=""http://www.uefa.com/MultimediaFiles/Download/competitions/EURO/01/76/11/53/1761153_DOWNLOAD.pdf"">здесь</a>.</p> </div></div></div>  </div><div class=""bF"">  </div> </div> </div><div class=""row  ""><div style="""" class=""box ADBox ""><div class=""bH""><!--googleoff:index--><!--googleon:index--> </div><div class=""bC""><div><!-- begin ad tag (tile=1) --><script type=""text/javascript"">if (typeof ord=='undefined') {ord=Math.random()*10000000000000000;}var AD_uefacom_EUROsection_mpu_com_4='http://ad.ch.doubleclick.net/adj/uefacom.russian/EUROsection;pos=mpu_com;tile=4;sect=;kw=;dcopt=ist;sz=300x100;ord=' + ord + '?';
